import React, { useLayoutEffect } from 'react';
import { 
  StyleSheet,
  Text
} from 'react-native';
import BackButton from '../../BackButton';

const styles = StyleSheet.create({
  container: {
    elevation: 0,
    shadowRadius: 0,
    shadowOpacity: 0,
    shadowOffset: {
      height: 0,
      width:0
    },
    borderBottomColor: 'transparent',
    borderBottomWidth: 0
  },

  title: {
    fontFamily: 'SulSans-Regular',
    color: 'rgb(62, 62, 62)',
    fontSize: 14
  }
});

const RestaurantDetails = ({route, navigation} : any) => {
  const restaurant = route.params.restaurant;

  useLayoutEffect(() => {
    navigation.setOptions({
      title: restaurant.name.toUpperCase(),
      headerLeft: () => (
        <BackButton onPress={() => navigation.goBack(null)} />
      ),
    });
  }, [navigation]);

  return (
    <>
      <Text>{restaurant.name}{restaurant.name}</Text>
    </>
  )
}

export default RestaurantDetails;
